import React from "react";
import caloriesIcon from "../assets/calories-icon.png"

const KpiCards = ({ data }) => {
  // Si données par encore chargées (nul, undefined)
  if (!data) return null;

  return (
    <div className="kpi-cards">
      <img className="calorie-icon" src={caloriesIcon} alt="calorie icon"/>
      <div className="card">
        <h3>{data.calorieCount} kcal</h3>
        <p>Calories</p>
      </div>
      <div className="card">
        <h3>{data.proteinCount} g</h3>
        <p>Protéines</p>
      </div>
      <div className="card">
        <h3>{data.carbohydrateCount} g</h3>
        <p>Glucides</p>
      </div>
      <div className="card">
        <h3>{data.lipidCount} g</h3>
        <p>Lipides</p>
      </div>
    </div>
  );
};

export default KpiCards;
